import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';

import { UserRouteAccessService } from 'app/core/auth/user-route-access.service';
import { GenerateReportComponent } from '../generate-report/generate-report.component';
import { QueryGeneratedReportComponent } from '../query-generated-report/query-generated-report.component';

const deductionRoutes: Routes = [
  {
    path: 'generate-report',
    component: GenerateReportComponent,
    data: {
      pageTitle: 'nspay2App.report.generate.home.title',
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  },
  {
    path: 'query-report',
    component: QueryGeneratedReportComponent,
    data: {
      pageTitle: 'nspay2App.report.query.home.title',
      defaultSort: 'id,asc'
    },
    canActivate: [UserRouteAccessService]
  }
];

@NgModule({
  imports: [RouterModule.forChild(deductionRoutes)],
  exports: [RouterModule]
})

export class ReportRoutingModule { }
